from musicdb.albumoftheyear import MusicDBParamsimport dbparseimport inspectfrom dbparse import ConcatFileTypedef test_concatmap():    mdbparams = MusicDBParams()    for concatName, concatType in mdbparams.concatMap.items():        assert isinstance(concatType, ConcatFileType), f'concatName [{concatName}] does not have a ConcatFileType'                concatClassName = getattr(concatType, "concatClassName")        assert isinstance(concatClassName, str), "No concat class name is set!"                concatClass = getattr(dbparse, concatClassName)        assert inspect.isclass(concatClass), f"No merge class with name [{concatClassName}]"                concatFunc = getattr(concatClass, "concat")        assert callable(concatFunc), f"concat() from {concatClassName} is not a callable"         if __name__ == "__main__":    test_concatmap()    